import React from "react";
import Todo from "./Todo";

const Navbar = ({ todos, setTodos, filteredTodos }) => {
  let e
  return (
    <div className="todo-container">
    <ul className="todo-list">
      {filteredTodos.map((todo) => (
        <Todo
          key={todo.id}
          text={todo.text}
          setTodos={setTodos}
          todos={todos}
          todo={todo}
        />
      ))}
    </ul>
  </div>
  );
}

export default Navbar;
